import './Nav.css';



const Nav=() => {
  return (
    <div className='Nav'>
            <ul>
        <li><a href="">Поиск анкет</a></li>
		    <li><a href="">Симпатии</a></li>
	      <li><a href="">Опросы</a></li>
				<li><a href="">Об отношениях</a></li>
        <li><a href="">Регистрация</a></li>	
	      <li><a href="">Вход</a></li>
</ul>
    </div>
  );
}

export default Nav;
